import React from "react";
import * as Custom from "./typeHeader";
import { Link } from "react-router-dom";
// import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// import { faSearch, faShoppingCart } from "@fortawesome/free-solid-svg-icons";
// import { faHeart } from "@fortawesome/free-regular-svg-icons";
// import { useDispatch, useSelector } from "react-redux";
// import * as action from "../../actions";
// import LoginForm from "../LoginForm";

export default () => {
  return (
    <Custom.Header>
      <div id="wrapper">
        <nav className="navbar navbar-default navbar-static-top m-b-0">
          <div className="navbar-header">
            <ul className="nav navbar-top-links navbar-right pull-right">
              <li>
                <form className="app-search hidden-sm hidden-xs m-r-10" role="search"><input className="form-control" type="text" placeholder="Search..." /><a href="# "><i className="fa fa-search"></i></a></form>
              </li>
              <li><a className="profile-pic" href="/"><img className="img-circle" src={require("../images/users/67396445_715918092179622_3974737570952118272_n.jpg")} alt="user-img" width="36" /><b className="hidden-xs">Linh Nguyễn</b></a></li>
            </ul>
          </div>
        </nav>
      </div>
      <div className="navbar-default sidebar" role="navigation">
        <div className="sidebar-nav slimscrollsidebar">
          <div className="top-left-part sidebar-head"><a className="logo" href="/admin"><img src="../images/icons/logo-01.png" alt="IMG-LOGO" /></a></div>
          <ul className="nav" id="side-menu">
            <li style={{ padding: '70px 0 0 0' }}><a className="waves-effect" href="/admin"><i className="fa fa-table fa-fw" aria-hidden="true"></i>Product Table</a></li>
            <li><a className="waves-effect" href="/admin/insertProduct"><i className="fa fa-user fa-fw" aria-hidden="true"></i>Add product</a></li>
            <li><a className="waves-effect" href="/admin/showListCategories"><i className="fa fa-table fa-fw" aria-hidden="true"></i>Category Table</a></li>
          </ul>
        </div>
      </div>
    </Custom.Header>
  )
}
